// bubble sort with 10000 array entries
function bubbleSort($arr, $size) {
    // $n;
    // $i;
    // $j;
    // $temp;
    $n = $size;

    $i = 0;
    while ($i < $n - 1) {
        $j = 0;
        while ($j < $n - $i - 1) {
            if ($arr[$j] > $arr[$j + 1]) {
                $temp = $arr[$j];
                $arr[$j] = $arr[$j + 1];
                $arr[$j + 1] = $temp;
            }
            $j = $j + 1;
        }
        $i = $i + 1;
    }

    return $arr;
}

function printArray($arr, $size) {
    // int n;
    // int i;
    $n = $size;

    $i = 0;
    while ($i < $n) {
        println($arr[$i]);
//         echo $arr[$i] . "\n";
        $i = $i + 1;
    }

}
